import React, { Component } from "react";
import Typewriter from "typewriter-effect";

import "slick-carousel/slick/slick.css";
import HomeC from "./HomeC";
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";
import logo from "../src/images/IMG_20210329_205312_237.jpg";
// import forward from "../src/icons/next.svg";
// import backward from "../src/icons/pre.svg";
import ic from "../src/images/s5.webp";

import ic1 from "../src/images/s2.jpg";
import ic2 from "../src/images/s3.webp";
import ic3 from "../src/images/s4.webp";

export default class SimpleSlider extends Component {
  render() {
    const settings = {
      dots: false,
      infinite: true,
      speed: 500,
      autoplay: true,
      autoplaySpeed: 2000,

      slidesToShow: 3,

      slidesToScroll: 1,
    };
  return (
    <>
     
      <header>





        <div className="container">
          <div className="logo flex justify-center align-items">
            <img src={logo} />
          </div>
          <div className="text flex justify-center align-items">
                <strong className="flex">Hey User! &nbsp; 
                    <Typewriter
                    options={{
                        autoStart:true,
                        loop:true,
                        delay:20,
                        deleteSpeed: 5,
                        strings: ['Welcome to Code with Sahil.', 'We Provide You the best web designs', 'Learn css styles.', 'Web designs and more...', 'Thank You So Much For Visiting Our Website.'],                    }}/>
               </strong>

            <p>
              Here you get all awesome features to implement in you websites.So
              don't confuse where to start and when to start.
            </p>
            <p>
              {" "}
              we provide you the best youtube free channels to learn full course
              of Web development, Python ,java and many much more...
            </p>
            <div className="btn-main">
              <a href="#">
                <button className="btn-bg4 btn-clr1">Watch videos</button>
              </a>
              <a href="#">
                <button className="btn-bg4 btn-clr2">
                  Subscribe Our Channel
                </button>
              </a>
              <a href="">
                <button className="btn-bg4 btn-clr3">Browse Blogs</button>
              </a>
            </div>
          </div>
        </div>
      </header>
      <section className="top-products">
        <div className="container-2">
          <h1 className="section-heading">Important Topics</h1>
         
          <Slider {...settings}>
          <HomeC
            imgsrc={ic}
          />
          <HomeC
            imgsrc={ic2}
          />
          <HomeC
            imgsrc={ic3}
          />
          <HomeC
            imgsrc={ic1}
          />

            
             
          </Slider>
        </div>
      </section>
      
     
      
    
   
    </>
    

  );
};
}
